import React from 'react'
import './cartCard.scss'
import { v4 as uuidv4 } from 'uuid'

const CartCard = (props) => {
    let items = props.items
    console.table(items)
    return (
        <div className='cartCard'>
            {items.map(item => (
                <div  key={uuidv4()}>
                    <img src="" alt="" />
                <p>{item.productName}</p>
                <p>{item.productPrice}</p>
                </div>
            ))}
        </div>
    )
}

export default CartCard
